import React from 'react';
import styled from 'styled-components';

const StyledAside = styled.aside`
  display: flex;
  flex-direction: column;
  align-items: space-evenly;
`;

const Button = styled.button`
  width: 53px;
  height: 177px;
  background: ${(props) => props.colour};
`;

const links = [
  {
    title: 'github',
    href: 'www.github.com',
    colour: ' #2D4E35 ',
  },
  { title: 'linkedin', href: 'www.linkedin.com', colour: '#E9ECE6 ' },
];

export default function AsideButtons() {
  return (
    <StyledAside>
      {links.map((item) => {
        <Button colour="#E9ECE6">{}</Button>;
      })}
      <Button colour="#2D4E35">{}</Button>
    </StyledAside>
  );
}
